SodaCanvas::SodaCanvas ()
{
    //[Constructor_pre] You can add your own custom stuff here..

	//set pixel size 10 as default.
	resolution = 64; //64x64 resolution
    //[/Constructor_pre]


    //[UserPreSize]
    //[/UserPreSize]

    setSize (600, 400);


    //[Constructor] You can add your own custom stuff here..
	//reset playback settings to 0
	playbackSettings = 0;
	//for now only have one layer at init time. layer id = 0
	//createLayer(0);
	createLayer_Internal(0, nullptr);

	canvasUpdateFPS = 60;
	setFramesPerSecond(canvasUpdateFPS);
	playbackFPS = 5;

	setWantsKeyboardFocus(true);

    //[/Constructor]
}

SodaCanvas::~SodaCanvas()
{
    //[Destructor_pre]. You can add your own custom destruction code here..
    //[/Destructor_pre]



    //[Destructor]. You can add your own custom destruction code here..

	//deallocate every layer
	for (auto& layer : layers)
		delete layer;

	//deallocate all commands
	while (!undoStack.empty())
	{
		delete undoStack.top();
		undoStack.pop();
	}

	while (!redoStack.empty())
	{
		delete redoStack.top();
		redoStack.pop();
	}
    //[/Destructor]
}

