void SodaCanvas::getActiveLayerID(size_t * outID) const
{
	*outID = activeLayerId;
}

bool SodaCanvas::isActiveLayer(size_t id) const
{
	return activeLayerId == id;
}

bool SodaCanvas::findLayerIndex(size_t id, size_t * outIndex) const
{
	auto IterFinder = layerIDmap.find(id);
	if (IterFinder == layerIDmap.end())
		return false;

	*outIndex = IterFinder->second;
	return true;
}

bool SodaCanvas::getLayer(size_t id, SodaLayer** outLayer)
{
	size_t Index;

	//find the index mapped to the id
	if (false == findLayerIndex(id, &Index)) return false;

	if (Index >= 0 && Index < layers.size())
	{
		//change the outindex to the active layer if valid and return true
		*outLayer = layers[Index];
		return true;
	}
	return false;
}

void SodaCanvas::resizeLayer(SodaLayer & layer)
{
	int LayerWidth = layer.getWidth();
	int LayerHeight = layer.getHeight();

	layer.setBounds
	((getWidth() / 2) - (LayerWidth / 2)
		, (getHeight() / 2) - (LayerHeight / 2)
		, resolution * gProperties.pixelSize
		, resolution * gProperties.pixelSize);

	//second resize to get the new Width & Height
	//after the First Layer Set Bounds

	LayerWidth = layer.getWidth();
	LayerHeight = layer.getHeight();

	layer.setBounds
	((getWidth() / 2) - (LayerWidth / 2)
		, (getHeight() / 2) - (LayerHeight / 2)
		, resolution * gProperties.pixelSize
		, resolution * gProperties.pixelSize);
}

bool SodaCanvas::registerNewCommand(FSodaCommand * command, bool execute)
{
	if (!command) return false;

	//execute if bool is true.
	if (execute)
	{
		//if execution fails, don't push to stack
		if (false == command->execute(this))
		{
			delete command;
			return false;
		}
	}

	//clear the redoStack when there's a new action incoming, since we are writing a new history
	while (!redoStack.empty())
	{
		delete redoStack.top();
		redoStack.pop();
	}

	//push command to undo stack.
	undoStack.emplace(command);
	return true;
}

bool SodaCanvas::undo()
{
	//don't process if stack empty or currently drawing
	if (undoStack.empty() || isDrawing)
		return false;

	//check out top and pop right after
	FSodaCommand* undoCommand = undoStack.top();
	undoStack.pop();
	if (undoCommand)
	{
		//if it was a sucessful undo, emplace it in the redoStack
		if (undoCommand->undo(this))
		{
			redoStack.emplace(undoCommand);
			return true;
		}
		else
		{
			delete undoCommand; //delete if not successful. (mem leak if we don't as we are not emplacing it anywhere else!)
			return false;
		}
	}
	return false;
}

bool SodaCanvas::redo()
{
	//don't process if stack empty or currently drawing
	if (redoStack.empty() || isDrawing) return false;

	//check out top and pop right after
	FSodaCommand* redoCommand = redoStack.top();
	redoStack.pop();
	if (redoCommand)
	{
		//if it was a sucessful redo, emplace it in the undoStack
		if (redoCommand->execute(this))
		{
			undoStack.emplace(redoCommand);
			return true;
		}
		else
		{
			delete redoCommand; // delete if not successful. (mem leak if we don't as we are not emplacing it anywhere else!)
			return false;
		}
	}
	return false;
}

bool SodaCanvas::createLayer_Internal(size_t id, Image* source)
{
	size_t temp_index;
	//if find returns true, we don't process further. The layer ID already exists.
	if (findLayerIndex(id, &temp_index))
		return false;

	layers.emplace_back(new SodaLayer(resolution, resolution));
	size_t index = layers.size() - 1;

	layerIDmap.emplace(id, index);
	setActiveLayer_Internal(id);

	SodaLayer* layer = layers.back();
	//set bounds so that we see the layer at the center
	resizeLayer(*layer);

	if(source)
		*(layer->getLayerImage()) = source->createCopy();

	OnLayerCreated.Call(id);

	return true;
}

bool SodaCanvas::deleteLayer_Internal(size_t id, Image* copy)
{
	size_t index;
	//find the index to the layer we want to delete
	if (false == findLayerIndex(id, &index))
		return false;
	if (index >= 0 && index < layers.size())
	{
		//decrease all the indices that are going to be moved down
		// from the map. We preserve the IDs but their indices will decrease by 1
		for (auto& i : layerIDmap)
			if (i.second >= index)
				--i.second;

		if (copy)
			*copy = layers[index]->getLayerImage()->createCopy();

		delete layers[index];

		layers.erase(layers.begin() + index);
		
		if (index >= layers.size())
			index = layers.size() - 1;

		setActiveLayerIndex_Internal(index);
		OnLayerDestroyed.Call(id);

		layerIDmap.erase(id);
		return true;
	}
	else
		return false;
}

bool SodaCanvas::setActiveLayerIndex_Internal(size_t index)
{
	//don't do anything if its outside the range..
	if (index < 0 || index >= layers.size()) return false;

	//Deactivate the Current Layer if we know it's a Valid one!
	if (activeLayer >= 0 && activeLayer < layers.size())
		layers[activeLayer]->setVisible(false);

	activeLayer = index;

	for (auto& i : layerIDmap)
		if (i.second == activeLayer)
		{
			activeLayerId = i.first;
			break;
		}

	//show the new layer and call its activation func
	layers[activeLayer]->setVisible(true);
	layers[activeLayer]->onActivation();
	return true;
}

bool SodaCanvas::setActiveLayer_Internal(size_t id)
{
	size_t index;
	if (false == findLayerIndex(id, &index)) return false;
	return setActiveLayerIndex_Internal(index);
}

bool SodaCanvas::moveLayer_Internal(size_t target, size_t destination, bool isBeforeDestination)
{
	size_t targetIndex;
	size_t destinationIndex;

	//check that both Indices are found in the map
	if (false == findLayerIndex(target, &targetIndex) ||
		false == findLayerIndex(destination, &destinationIndex)) 
			return false;

	//check if any of the indices are out of range
	if (targetIndex < 0 || targetIndex >= layers.size()) 
		return false;
	if (destinationIndex < 0 || destinationIndex >= layers.size()) 
		return false;

	//if same, we don't move. 
	if (targetIndex == destinationIndex)
		return true;

	SodaLayer* pTargetLayer = layers[targetIndex];

	//in the case that target is further down the deque, we have to move the elements on the left (front)
	if (targetIndex > destinationIndex)
	{
		//limitIndex: if isBeforeDest means we place the target more to the left so we have to move
		// destination layer as well. else, we are placing it right after destination layer so we just start moving from
		//destinationIndex + 1
		size_t limitIndex = (isBeforeDestination) ? destinationIndex : destinationIndex + 1;
		for (int i = targetIndex; i > limitIndex; --i)
			layers[i] = layers[i - 1];
		layers[limitIndex] = pTargetLayer;
	}
	//else, we move the elements on the right (back)
	else
	{
		//limitIndex: if isBeforeDest means we place the target more to the left so we ** DONT** have to move
		// destination layer in this case. else, we are placing it right after destination layer so 
		//we move all the items including destination layer
		size_t limitIndex = (isBeforeDestination) ? destinationIndex - 1 : destinationIndex;
		for (int i = targetIndex; i < limitIndex; ++i)
			layers[i] = layers[i + 1];
		layers[limitIndex] = pTargetLayer;
	}
}

